func TestResponseWithLongDate(t *testing.T) {
	var resp RoutingResponse
	r := strings.NewReader(longDateResponse)
	err := xml.NewDecoder(r).Decode(&resp)
	if err != nil {
		t.Errorf("Failed to parse: %v", err)
	}

	err = resp.Valid()
	if err != nil {
		t.Errorf("Response did not validate: %v", err)
	}

	expected := "2016-10-04T16:16:00+02:00"
	actual := time.Time(resp.CreationDate).Format("2006-01-02T15:04:05-07:00")
	if expected != actual {
		t.Errorf("Failed to parse time correctly - expected was %q but actually got %q", expected, actual)
	}
}

